class Color:
    def __init__(self, hex:str = None, rgb:tuple = None) -> None:    
        self.hex = hex
        self.rgb = rgb

def hex2rgb(hex:str) -> tuple:
    r = int(hex[1:3], 16)
    g = int(hex[3:5], 16)
    b = int(hex[5:7], 16)

    return (r,g,b)

def rgb2hex(rgb:tuple) -> str:
    r, g, b = rgb
    return f"#{hex(r)}{hex(g)}{hex(b)}"


